import { NgModule } from '@angular/core';
import { BrowserModule } from '@angular/platform-browser';

import { AppRoutingModule } from './app-routing.module';
import { AppComponent } from './app.component';
import { CarsListComponent } from './components/cars/cars-list/cars-list.component';
import { ProfileListComponent } from './components/profile/profile-list/profile-list.component';
import { OrdersListComponent } from './components/orders/orders-list/orders-list.component';
import { StartlistComponentComponent } from './components/Startlist/startlist-component/startlist-component.component';

@NgModule({
  declarations: [
    AppComponent,
    CarsListComponent,
    ProfileListComponent,
    OrdersListComponent,
    StartlistComponentComponent
  ],
  imports: [
    BrowserModule,
    AppRoutingModule
  ],
  providers: [],
  bootstrap: [AppComponent]
})
export class AppModule { }
